import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

function Warehouse() {
	let id = useParams();

	useEffect(() => {
		fetch(`warehouse/${id.id}`);
	}, []);
	return <div>Loading...</div>;
}

export default Warehouse;
